ect to GoDaddy Email Marketing. Please check your credentials.'=>'Не удалось подключиться к GoDaddy Email Marketing. Проверьте свои учетные данные.','Unable to connect to Mad Mimi. Please check your credentials.'=>'Не удается подключиться к Mad Mimi. Пожалуйста, проверьте Ваши учетные данные.','Uncategorized'=>'Без категории','Underline'=>'Подчеркивание','Uninstall'=>'Деинсталлировать','Unnamed Menu'=>'Без названия','Unrestricted Editing'=>'Неограниченное редактирование','Untitled Preset'=>'Без названия','Untitled Shape'=>'Без названия','Updates &amp; Support Subscription'=>'Подписка на обновления и поддержку','Upgrade'=>'Обновление','Upgrade message that displays in the templates tab in lite installs.Save and reuse your layouts or kick-start your creativity with dozens of professionally designed templates.'=>'Сохраняйте и повторно используйте свои макеты или начинайте свое творчество с десятков профессионально разработанных шаблонов.','Upload a photo or display one from the media library.'=>'Загрузить фото или выбрать его из медиа-библиотеки.','Use Standard Editor'=>'Использовать стандартный редактор','Use an easy drag-and-drop builder to edit content on this page.'=>'Воспользуйтесь простым конструктором с поддержкой перетаскивания для редактирования контента на этой странице.','Use the Add Content button to open the content panel and add new row layouts, modules or widgets.'=>'Используйте кнопку «Добавить элементы», чтобы открыть панель элементов и добавлять новые макеты строк, модули или виджеты.','Use the Templates button to pick a new template or append one to your layout. Appending will insert a new template at the end of your existing page content.'=>'Используйте кнопку «Шаблоны», чтобы выбрать новый шаблон или добавить новый шаблон к Вашему макету. Добавление вставит новый шаблон в конце существующей страницы.','Use the action buttons to perform actions such as moving, editing, duplicating or deleting rows, columns and modules.'=>'Используйте кнопки действи